-- 
-- Table structure for table `BLUEDART_AIRWAY`
-- 


CREATE TABLE `BLUEDART_AIRWAY_TMP` (
 `AIRWAY_NUMBER` varchar(40) default NULL,
 `ENTRY_DT` datetime default '0000-00-00 00:00:00',
 UNIQUE KEY `AIRWAY_NUMBER` (`AIRWAY_NUMBER`)
);



CREATE TABLE `BLUEDART_COD_REQUEST` (
 `REF_ID` int(30) unsigned NOT NULL auto_increment,
 `BILLID` varchar(40) NOT NULL,
 `PROFILEID` mediumint(11) unsigned NOT NULL,
 `USERNAME` varchar(40) NOT NULL,
 `EMAIL` varchar(100) NOT NULL,
 `NAME` text NOT NULL,
 `PHONE_MOB` varchar(100) NOT NULL,
 `PHONE_RES` varchar(100) NOT NULL,
 `SERVICE` varchar(100) default NULL,
 `ENTRY_DT` date NOT NULL,
 `DISCOUNT_AMNT` varchar(100) default '0',
 `TOTAL_AMOUNT` varchar(100) NOT NULL,
 `ADDRESS` text NOT NULL,
 `PINCODE` varchar(10) NOT NULL,
 `CITY` varchar(10) NOT NULL,
 `AREA` text NOT NULL,
 `DESTARCD` varchar(10) NOT NULL,
 `COMMENTS` text NOT NULL,
 `AIRWAY_NUMBER` varchar(50) default NULL,
 `OPERATOR` varchar(40) NOT NULL,
 `ACTIVE` enum('Y','N') NOT NULL,
 `SENT_MAIL` enum('Y','N') default NULL,
 PRIMARY KEY  (`REF_ID`),
 KEY `REF_ID` (`REF_ID`),
 KEY `PROFILEID` (`PROFILEID`)
);


